"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[6327],{6327:e=>{e.exports=JSON.parse('{"lessonId":"B1_U99","title":"\u0423\u0440\u043e\u043a 99: \u041f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435 (Participio)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0424\u043e\u0440\u043c\u044b \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f","content":[{"text":"<strong>Terminado</strong> \u0438 <strong>cerrado</strong> \u2014 \u044d\u0442\u043e \u0444\u043e\u0440\u043c\u044b \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f (participio)."},{"text":"<strong>\u041f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b:</strong><br>-ar \u2192 -<strong>ado</strong> (trabaj-ar \u2192 trabaj-<strong>ado</strong>)<br>-er/-ir \u2192 -<strong>ido</strong> (com-er \u2192 com-<strong>ido</strong>, viv-ir \u2192 viv-<strong>ido</strong>)"},{"text":"<strong>\u041d\u0435\u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0435 \u0433\u043b\u0430\u0433\u043e\u043b\u044b:</strong><br>abrir \u2192 abierto, cubrir \u2192 cubierto, escribir \u2192 escrito, volver \u2192 vuelto, decir \u2192 dicho, poner \u2192 puesto, romper \u2192 roto, ver \u2192 visto, morir \u2192 muerto, hacer \u2192 hecho"}]},{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f","content":[{"text":"<strong>1. \u0421 \u0433\u043b\u0430\u0433\u043e\u043b\u043e\u043c `haber` \u0434\u043b\u044f \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u044f \u0441\u043b\u043e\u0436\u043d\u044b\u0445 \u0432\u0440\u0435\u043c\u0435\u043d.</strong> \u0424\u043e\u0440\u043c\u0430 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f \u043d\u0435 \u043c\u0435\u043d\u044f\u0435\u0442\u0441\u044f.<br><i>Mis padres <strong>han vuelto</strong> hace un rato. / Sonia no <strong>hab\xeda comido</strong> cuando la llam\xe9.</i>"},{"text":"<strong>- \u0421 \u0432\u043e\u0437\u0432\u0440\u0430\u0442\u043d\u044b\u043c\u0438 \u0433\u043b\u0430\u0433\u043e\u043b\u0430\u043c\u0438 \u043c\u0435\u0441\u0442\u043e\u0438\u043c\u0435\u043d\u0438\u044f \u0441\u0442\u0430\u0432\u044f\u0442\u0441\u044f \u043f\u0435\u0440\u0435\u0434 `haber`.</strong><br><i>Lidia no <strong>se hab\xeda atrevido</strong> a ba\xf1arse. / \xbf<strong>Os hab\xe9is lavado</strong>?</i>"},{"text":"<strong>2. \u041c\u043e\u0436\u0435\u0442 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c\u0441\u044f \u043a\u0430\u043a \u043f\u0440\u0438\u043b\u0430\u0433\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0435.</strong> \u0412 \u044d\u0442\u043e\u043c \u0441\u043b\u0443\u0447\u0430\u0435 \u043e\u043d\u043e \u0441\u043e\u0433\u043b\u0430\u0441\u0443\u0435\u0442\u0441\u044f \u0432 \u0440\u043e\u0434\u0435 \u0438 \u0447\u0438\u0441\u043b\u0435 \u0441 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c.<br><i>\xd3scar <strong>parece cansado</strong>. / Muchas personas <strong>estaban heridas</strong>.</i>"},{"text":"<strong>3. \u0412 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u044f\u0445:</strong><br><strong>- `estar` + \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435</strong> \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f.<br><i>Ya <strong>est\xe1 arreglada</strong> la lavadora.</i><br><strong>- `seguir` + \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435</strong> \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0435\u043d\u0438\u0435 \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f.<br><i>La puerta del sal\xf3n <strong>sigue rota</strong>.</i><br><strong>- `llevar` + \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u0435</strong> \u0443\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u0442 \u043d\u0430 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f \u0441 \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0435\u043d\u043d\u043e\u0433\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430.<br><i>Rita y Jaime <strong>llevan casados</strong> quince a\xf1os. / Rita y Jaime <strong>llevan quince a\xf1os casados</strong>.</i>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 99.1: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f\u043c\u0438 \u0433\u043b\u0430\u0433\u043e\u043b\u043e\u0432","tasks":[{"id":"u99_1_1","sentence":"1. \xbfQu\xe9 te ha ___ Diana de m\xed?","answer":"dicho"},{"id":"u99_1_2","sentence":"2. \xbfEst\xe1 Juana ___?","answer":"despierta"},{"id":"u99_1_3","sentence":"3. Se ha ___ la gasolina.","answer":"acabado"},{"id":"u99_1_4","sentence":"4. \xbfD\xf3nde has ___ la nueva l\xe1mpara?","answer":"puesto"},{"id":"u99_1_5","sentence":"5. A m\xed me encanta el cordero ___.","answer":"asado"},{"id":"u99_1_6","sentence":"6. Vargas Llosa ha ___ muchas novelas.","answer":"escrito"},{"id":"u99_1_7","sentence":"7. Mira. La peluquer\xeda ya est\xe1 ___. Podemos entrar.","answer":"abierta"},{"id":"u99_1_8","sentence":"8. Hay que cortar las ramas ___.","answer":"rotas"},{"id":"u99_1_9","sentence":"9. Paco siempre ha ___ mucha suerte.","answer":"tenido"},{"id":"u99_1_10","sentence":"10. Los barrenderos han ___ las hojas ___.","answer":"recogido, ca\xeddas"},{"id":"u99_1_11","sentence":"11. \xbfHas ___ ya a la nueva directora?","answer":"conocido"},{"id":"u99_1_12","sentence":"12. Mis amigos todav\xeda no han ___ de las vacaciones.","answer":"vuelto"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 99.2: \u0414\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435 \u0442\u0435\u043a\u0441\u0442 \u043f\u0440\u0438\u0447\u0430\u0441\u0442\u0438\u044f\u043c\u0438 \u0433\u043b\u0430\u0433\u043e\u043b\u043e\u0432 \u0438\u0437 \u0441\u043f\u0438\u0441\u043a\u0430","content":[{"text":"<strong>\u0413\u043b\u0430\u0433\u043e\u043b\u044b:</strong> alojar, asar, comprar, dedicar, desayunar, gustar, ir, levantar, pedir, tener, ver"}],"tasks":[{"id":"u99_2_1","sentence":"\xa1Hola Maribel!<br>Estoy en Madrid. He ___ con mi familia a pasar unos d\xedas. Es una ciudad tranquila en agosto. Estamos ___ en el hotel Asturias, junto a la Puerta del Sol. Hoy hemos ___ pronto, hemos ___ en el mismo hotel y hemos ___ al Museo del Prado. Hemos ___ las salas ___ a Goya. Hemos ___ mucho. Ahora mismo te estoy escribiendo desde un restaurante. Mi hermano y yo hemos ___ pollo ___ para cenar. Hace mucho calor. Te he ___ un regalo que espero que te guste. Besos y hasta pronto.","answer":"venido, alojados, levantado, desayunado, ido, visto, dedicadas, comido, pedido, asado, comprado"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 99.3: \u041f\u0435\u0440\u0435\u043f\u0438\u0448\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 estar, seguir \u0438\u043b\u0438 llevar","tasks":[{"id":"u99_3_1","sentence":"1. Se ha estropeado el ordenador. \u2192 El ordenador ___.","answer":"est\xe1 estropeado"},{"id":"u99_3_2","sentence":"2. La biblioteca cerr\xf3 hace tiempo y a\xfan estaba cerrada cuando fui ayer. \u2192 ___","answer":"La biblioteca segu\xeda cerrada"},{"id":"u99_3_3","sentence":"3. Esta academia abri\xf3 en 2002 y a\xfan est\xe1 abierta. \u2192 ___","answer":"Esta academia lleva abierta desde 2002"},{"id":"u99_3_4","sentence":"4. El tren par\xf3 hace un rato y a\xfan est\xe1 parado. \u2192 ___","answer":"El tren sigue parado"},{"id":"u99_3_5","sentence":"5. Se hab\xeda roto el m\xf3vil. \u2192 ___","answer":"El m\xf3vil estaba roto"},{"id":"u99_3_6","sentence":"6. La impresora se hab\xeda averiado hac\xeda una semana. \u2192 ___","answer":"La impresora llevaba averiada una semana"},{"id":"u99_3_7","sentence":"7. Esta comida se hizo hace dos d\xedas. \u2192 ___","answer":"Esta comida est\xe1 hecha"},{"id":"u99_3_8","sentence":"8. Hace poco detuvieron al sospechoso y a\xfan est\xe1 detenido. \u2192 ___","answer":"El sospechoso sigue detenido"}]}]}')}}]);